})(OutgoingMessages || (OutgoingMessages = {}));
;
(function () {
    let tutorialFileName = "Tutorial";
    function startTutorial() {
        window._bridge(OutgoingMessages.OPEN_TUTORIAL, tutorialFileName);
    }
    function addOnClick(elemId, callback) {
        const element = document.getElementById(elemId);
        element && element.addEventListener("click", callback, false);
    }
    const dataMetricsElements = document.body.querySelectorAll("[data-metric-id]");
    dataMetricsElements.forEach(elem => {
        const dataId = elem.dataset["metric-id"];
        if (dataId) {
            elem.addEventListener("click", () => {
                window._bridge(OutgoingMessages.METRICS_UI_INTERACTION, dataId);
            });
        }
    });
    addOnClick("tutorial-start-button", () => startTutorial());
    window._bridge(OutgoingMessages.READY);
})();</script> </body> </html>
